---
cc__container_default_autostart: "true"
cc__container_default_limits_cpu: ""
cc__container_default_limits_cpu_allowance: "100%"
cc__container_default_limits_memory: ""
cc__container_default_profiles: ["default"]
cc__container_default_security_nesting: "false"
cc__container_default_security_privileged: "false"
cc__container_default_source_alias: 18.04
cc__container_default_source_protocol: simplestreams
cc__container_default_source_server: https://cloud-images.ubuntu.com/releases
cc__container_default_source_type: image
cc__container_default_wait_for_ipv4_addresses: "true"
cc__container_default_state: started
cc__container_default_missing_config:
  user.network-config:
  user.user-data:
  user.meta-data:
  user.vendor-data:
